import React from 'react';

//Components
import Game from './Game.js';

const GameTable = () => {
    const game = {title,genre,played};
    game.title = 'God of var';
    game.genre = 'Actions';
    game.played = true;

    return (
        <div>
            <table class="table">
                <thead>
                    <tr>
                    <th scope="col">#</th>
                    <th scope="col">First</th>
                    <th scope="col">Last</th>
                    <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    <game props={game} />
                </tbody>
            </table>

        </div>
    );
};

export default GameTable;
